class Solution
{
public:
    int maxProduct(vector<int> &nums)
    {
        if(nums.size()==1){
            return nums[0];
        }
        vector<int> newNums;
        int _max = INT_MIN;
        for (int i = 0; i < nums.size(); i++)
        {
            _max = max(_max, nums[i]);
            bool negaOne = false;
            if (abs(nums[i]) != 1)
            {
                newNums.push_back(nums[i]);
            }
            else
            {
                int count = 0;
                if (nums[i] == -1)
                {
                    count++;
                    negaOne = true;
                }
                while (i+1 < nums.size() && abs(nums[i+1]) == 1)
                {
                    if (nums[i+1] == -1)
                    {
                        count++;
                        negaOne = true;
                    }
                    i++;
                }
                if (negaOne)
                {
                    newNums.push_back(-1);
                    if(count>1){
                        newNums.push_back(-1);
                    }
                }
            }
        }
        if (newNums.size() < 1)
        {
            return 1;
        }
        vector<vector<int>> dp(newNums.size(), vector<int>(newNums.size(), 0));
        for (int c = 0; c < newNums.size(); c++)
        {
            dp[0][c] = newNums[c];
            
        }
        for (int r = 1; r < newNums.size(); r++)
        {
            for (int c = r; c < newNums.size(); c++)
            {
                dp[r][c] = dp[r - 1][c - 1] * dp[0][c];
                _max = max(_max, dp[r][c]);
            }
        }
        return _max;
    }

    int maxProduct_v1(vector<int> &nums)
    {
        int _min = INT_MAX;
        int _max = INT_MIN;
        int res = 1;
        for (int i = 0; i < nums.size(); i++)
        {
            res *= nums[i];
            _max = max(_max, res);
            _min = min(_min, res);
        }
        int tmpMax = _max;
        int tmpMin = _min;
        for (int i = 0; i < nums.size(); i++)
        {
            _max = max(_max, tmpMin /= nums[i]);

            _min = min(_min, tmpMax /= nums[i]);
        }
        return _max;
    }
    void dfs(vector<int> nums, int start, int &next, int res, int &_max)
    {
        _max = max(_max, res);
        next += 1;
        while (next < nums.size())
        {
            dfs(nums, start, next, res * nums[next], _max);
        }
    }
};
